import React,{useState} from 'react';
import { Form, Alert } from "react-bootstrap";
import './Registration.css';

const Registration = () => {


  const [fname, fsetName] = useState("");
  const [lname, lsetName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [rpassword, rsetPassword] = useState("");


  const [flag, setFlag] = useState(false);
  const [login, setLogin] = useState(true);



  function handleFormSubmit(e) {
    e.preventDefault();

    if (!fname || !lname || !email || !password || !rpassword) {
      setFlag(true);
    } else {
      setFlag(false);
      localStorage.setItem("Email", JSON.stringify(email));
      localStorage.setItem(
        "Password",
        JSON.stringify(password)
      );
      console.log("Saved in Local Storage");

      setLogin(!login);
    }
  }

  function handleClick() {
    setLogin(!login);
  }



    return (
        <div className='container' id='Registration'>
           <div>
           {" "}
           {login ? (
            <form onSubmit={handleFormSubmit}>
              <h3>Register</h3>

              <div className="form-group">
                <label>First Name</label>
                <input
                  type="text"
                  className="form-control"
                  placeholder="Enter First Name"
                  name="name"
                  onChange={(event) => fsetName(event.target.value)}
                />
              </div>

              <div className="form-group">
                <label>Last Name</label>
                <input
                  type="text"
                  className="form-control"
                  placeholder="Enter Last Name"
                  name="name"
                  onChange={(event) => lsetName(event.target.value)}
                />
              </div>

              <div className="form-group">
                <label>Email</label>
                <input
                  type="email"
                  className="form-control"
                  placeholder="Enter email"
                  onChange={(event) => setEmail(event.target.value)}
                />
              </div>

              <div className="form-group">
                <label>Password</label>
                <input
                  type="password"
                  className="form-control"
                  placeholder="Enter password"
                  onChange={(event) => setPassword(event.target.value)}
                />
              </div>

              <div className="form-group">
                <label>Repeat Password</label>
                <input
                  type="password"
                  className="form-control"
                  placeholder="Enter contact no"
                  onChange={(event) => rsetPassword(event.target.value)}
                />
              </div>



              <button type="submit" className="btn btn-dark btn-lg btn-block">
                Register
              </button>
              <p onClick={handleClick} className="forgot-password text-right">
                Already registered{" "}log in?

              </p>
              {flag && (
                <Alert color="primary" variant="danger">
                 please fill important field;
                </Alert>
              )}
            </form>
          ) : (
            <Login />
          )}
       </div>
        </div>
    )
}

export default Registration




